void drawChessBoard(){
    uint16_t refY = MIN_SCREEN_Y;
    uint16_t refX = MIN_SCREEN_X;
    char tog = 0;

    /* DRAW BACKGROUND */
    for(int i = 0; i<4; i++){
        for(int j = 0; j<6; j++){
            LCD_DrawSprite(refX, refX+TEXTURE_SIDE, refY, refY + TEXTURE_SIDE, background);
            refX = refX + TEXTURE_SIDE;
        }
        refY = refY + TEXTURE_SIDE;
        refX = MIN_SCREEN_X;
    }

    /* DRAW CHESS BOARD BORDER */
    LCD_DrawRectangle(MIN_SCREEN_X + X_OFFSET - BORDER_WIDTH, MIN_SCREEN_X + X_OFFSET + 8*SQUARE_SIDE + BORDER_WIDTH,
                      MIN_SCREEN_Y + Y_OFFSET - BORDER_WIDTH, MIN_SCREEN_Y + Y_OFFSET, LCD_BLACK);

    LCD_DrawRectangle(MIN_SCREEN_X + X_OFFSET - BORDER_WIDTH, MIN_SCREEN_X + X_OFFSET + BORDER_WIDTH,
                      MIN_SCREEN_Y + Y_OFFSET, MIN_SCREEN_Y + Y_OFFSET + 8*SQUARE_SIDE, LCD_BLACK);

    LCD_DrawRectangle(MIN_SCREEN_X + X_OFFSET + 8*SQUARE_SIDE, MIN_SCREEN_X + X_OFFSET + 8*SQUARE_SIDE + BORDER_WIDTH,
                      MIN_SCREEN_Y + Y_OFFSET, MIN_SCREEN_Y + Y_OFFSET + 8*SQUARE_SIDE, LCD_BLACK);

    LCD_DrawRectangle(MIN_SCREEN_X + X_OFFSET - BORDER_WIDTH, MIN_SCREEN_X + X_OFFSET + 8*SQUARE_SIDE + BORDER_WIDTH,
                      MIN_SCREEN_Y + Y_OFFSET + 8*SQUARE_SIDE, MIN_SCREEN_Y + Y_OFFSET + 8*SQUARE_SIDE + BORDER_WIDTH, LCD_BLACK);

    /* DRAW WHITE SQUARES */
    refY = MIN_SCREEN_Y + Y_OFFSET;
    refX = MIN_SCREEN_X + X_OFFSET;
    for(int i = 0; i<8; i++){
        for(int j = 0; j<4; j++){
            LCD_DrawRectangle(refX, refX+SQUARE_SIDE, refY, refY+SQUARE_SIDE, LCD_WHITE);
            refX = refX + 2*SQUARE_SIDE;
        }
        refY = refY + SQUARE_SIDE;
        tog ^= 1;
        if(tog == 0){
            refX = MIN_SCREEN_X + X_OFFSET;
        }else{
            refX = SQUARE_SIDE + X_OFFSET;
        }
    }

    /* DRAW BLACK SQUARES */
    tog = 1;
    refY = MIN_SCREEN_Y + Y_OFFSET;
    refX = MIN_SCREEN_X+SQUARE_SIDE + X_OFFSET;
    for(int i = 0; i<8; i++){
        for(int j = 0; j<4; j++){
            LCD_DrawRectangle(refX, refX+SQUARE_SIDE, refY, refY+SQUARE_SIDE, LCD_BLACK);
            refX = refX + 2*SQUARE_SIDE;
        }
        refY = refY + SQUARE_SIDE;
        tog ^= 1;
        if(tog == 0){
            refX = MIN_SCREEN_X + X_OFFSET;
        }else{
            refX = SQUARE_SIDE + X_OFFSET;
        }
    }

    /* Add matrix labels */
    PutChar(0, Y_OFFSET,                                '8', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE   + BORDER_WIDTH, '7', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*2 + BORDER_WIDTH, '6', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*3 + BORDER_WIDTH, '5', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*4 + BORDER_WIDTH, '4', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*5 + BORDER_WIDTH, '3', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*6 + BORDER_WIDTH, '2', 1, LCD_GREEN);
    PutChar(0, Y_OFFSET + SQUARE_SIDE*7 + BORDER_WIDTH, '1', 1, LCD_GREEN);

    PutChar(X_OFFSET                 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'A', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE   + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'B', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*2 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'C', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*3 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'D', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*4 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'E', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*5 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'F', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*6 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'G', 1, LCD_GREEN);
    PutChar(X_OFFSET + SQUARE_SIDE*7 + 2*BORDER_WIDTH, Y_OFFSET + 8*SQUARE_SIDE, 'H', 1, LCD_GREEN);

    /* DRAW BUTTONS */
    LCD_DrawRectangleBrdr(BUTTON_OFFSET_X, BUTTON_OFFSET_X + BUTTON_LENGTH,
                          Y6, Y6+BUTTON_WIDTH, 3, LCD_GREEN, LCD_BLACK);
    LCD_Text(BUTTON_OFFSET_X+15, Y6, "NEXT", 2, LCD_BLACK);

    LCD_DrawRectangleBrdr(BUTTON_OFFSET_X, BUTTON_OFFSET_X + BUTTON_LENGTH,
                          Y4+13, Y4+BUTTON_WIDTH+13, 3, LCD_GREEN, LCD_BLACK);
    LCD_Text(BUTTON_OFFSET_X+12, Y4+13, "PREV", 2, LCD_BLACK);

    LCD_DrawRectangleBrdr(BUTTON_OFFSET_X, BUTTON_OFFSET_X + BUTTON_LENGTH,
                          Y2+26, Y2+BUTTON_WIDTH+26, 3, LCD_RED, LCD_BLACK);
    LCD_Text(BUTTON_OFFSET_X, Y2+26, "RESET", 2, LCD_BLACK);

    /* DRAW DIFFICULTY BOX */
    LCD_DrawRectangleBrdr(BUTTON_OFFSET_X, BUTTON_OFFSET_X + BUTTON_LENGTH + 3,
                          Y8, Y8+BUTTON_WIDTH, 3, LCD_GREEN, LCD_BLACK);
    LCD_Text(BUTTON_OFFSET_X+15, Y8, "EASY", 2, LCD_BLACK);

}

void drawPiece(uint16_t posX, uint16_t posY, fl fill, char piece){
    bg background;
    uint16_t color;
    if(((posX%2 == 0 && posY%2 == 0)) || ((posX%2 != 0 && posY%2 != 0))){ //even
        background = BLACK;
        color = LCD_BLACK;
    }else{
        background = WHITE;
        color = LCD_WHITE;
    }
    switch(posX){
        case 1:
            posX = X1;
            break;
        case 2:
            posX = X2;
            break;
        case 3:
            posX = X3;
            break;
        case 4:
            posX = X4;
            break;
        case 5:
            posX = X5;
            break;
        case 6:
            posX = X6;
            break;
        case 7:
            posX = X7;
            break;
        case 8:
            posX = X8;
            break;
        default:
            return;
    }

    switch(posY){
        case 1:
            posY = Y1;
            break;
        case 2:
            posY = Y2;
            break;
        case 3:
            posY = Y3;
            break;
        case 4:
            posY = Y4;
            break;
        case 5:
            posY = Y5;
            break;
        case 6:
            posY = Y6;
            break;
        case 7:
            posY = Y7;
            break;
        case 8:
            posY = Y8;
            break;
        default:
            return;
    }

    if(piece == 'P' || piece == 'p'){
        piece = P;
    }else if((piece == 'N' || piece == 'n')){
        piece = N;
    }else if((piece == 'B' || piece == 'b')){
        piece = B;
    }else if((piece == 'R' || piece == 'r')){
        piece = R;
    }else if((piece == 'Q' || piece == 'q')){
        piece = Q;
    }else if((piece == 'K' || piece == 'k')){
        piece = K;
    }else if((piece == '.')){
        LCD_DrawRectangle(posX, posX + PIECE_WIDTH,
                                   posY, posY + PIECE_WIDTH,
                                   color);
        return;
    }

    if (fill == BLUE){
        LCD_DrawChessSprite(posX, posX + PIECE_WIDTH,
                            posY, posY + PIECE_WIDTH,
                            &b_chess_pieces[piece][0], background);
    }else{
        LCD_DrawChessSprite(posX, posX + PIECE_WIDTH,
                            posY, posY + PIECE_WIDTH,
                            &o_chess_pieces[piece][0], background);
    }
}

void drawPieces(char *pieces){
    int k = 0;
    for(int i = 8; i>0; i--){
        for(int j = 1; j<9; j++){
            if(pieces[k] != '.'){
                if(islower(pieces[k])){
                    drawPiece(j, i, BLUE, pieces[k]);
                }else{
                    drawPiece(j, i, ORANGE, pieces[k]);
                }
            }
            k++;
        }
    }
}

