    int k = 0;
//    for(int i = 8; i>0; i--){
    for(int i = 1; i<9; i++){
        for(int j = 1; j<9; j++){
            if(pieces[k] != newPieces[k]){
//                if(islower(newPieces[k])){
//                    drawPiece(j, i, BLUE, newPieces[k]);
//                }else{
//                    drawPiece(j, i, ORANGE, newPieces[k]);
//                }
                if((newPieces[k]<122) && (newPieces[k]>97)){
                    drawPiece(j, i, BLUE, newPieces[k]);
                }else{
                    drawPiece(j, i, ORANGE, newPieces[k]);
                }
            }
            k++;
        }
    }

    /* Assign pieces (UNCOMMENT) */
